import React from 'react';
import { Outlet } from 'react-router-dom';
import AdminNavbar from './AdminNavbar';

const AdminLayout = () => {
    return (
        <div>
            {/* Admin Navbar */}
            <AdminNavbar />

            {/* Content Area */}
            <div style={{ padding: '20px' }}>
                <Outlet /> {/* Renders child routes */}
            </div>
        </div>
    );
};

export default AdminLayout;
